import { StyleSheet } from 'react-native';

const styles = StyleSheet.create({
  container: {
    flex: 1,
    margin: 10,
  },
  itemContainer: {
    flex: 1,
    margin: 5,
    justifyContent: 'center',
    alignItems: 'center',
  },
  sprite: {
    width: 100,
    height: 100,
    backgroundColor: 'red', // Temporaire pour la visualisation
  },
  nameText: {
    marginTop: 10,
  },
});
